import rws_app_logo from './assets/rws_logo.png';
import { useState } from 'react';

function App() {
  const [email, settter_email] = useState("");
  const [password, setter_pass] = useState("");

  const login_logic = async (e) => {
    e.preventDefault();
    const res = await fetch("http://localhost:5001/auth/login", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify({ email, password }),
    });
    const data = await res.json();
    console.log(data);
  };

  return (
    <div className="min-h-screen flex items-center justify-center bg-gray-500">
      <div className="bg-white shadow-lg rounded-lg flex w-4/5 max-w-4xl">
        {/* Left: Logo */}
        <div className="w-1/2 flex flex-col items-center justify-center rounded-l-lg bg-white p-6">
          <img src={rws_app_logo} alt="logo" className="w-32 h-32 object-contain mb-4" />
          <p className="text-gray-700 text-lg font-medium text-center">
            Stay organized, stay ahead.
          </p>
        </div>

        {/* Right: Login Form */}
        <div className="w-1/2 p-8 flex flex-col justify-center">
          <h2 className="text-2xl font-bold mb-6 text-gray-800 text-center">Welcome Back!</h2>

          <form className="flex flex-col space-y-4" onSubmit={login_logic}>
            <input
              type="email"
              placeholder="Email"
              value={email}
              onChange={(e) => settter_email(e.target.value)}
              className="border border-gray-300 rounded px-4 py-2 focus:outline-none focus:ring-2 focus:ring-yellow-400"
            />
            <input
              type="password"
              placeholder="Password"
              value={password}
              onChange={(e) => setter_pass(e.target.value)}
              className="border border-gray-300 rounded px-4 py-2 focus:outline-none focus:ring-2 focus:ring-yellow-400"
            />

            <div className="flex justify-center">
              <button
                type="submit"
                className="w-1/2 bg-yellow-400 text-white font-bold py-2 rounded hover:bg-yellow-500 transition"
              >
                Login
              </button>
            </div>
          </form>

          <p className="mt-4 text-gray-500 text-sm text-center">
            Don't have an account?{' '}
            <a href="#" className="text-yellow-500 hover:underline">Sign Up</a>
          </p>
        </div>
      </div>
    </div>
  );
}

export default App;
